{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/juddynjogu/bike-share-tripdata-code?scriptVersionId=103609253\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"9514f1b3","metadata":{"papermill":{"duration":0.049441,"end_time":"2022-08-18T11:36:28.503329","exception":false,"start_time":"2022-08-18T11:36:28.453888","status":"completed"},"tags":[]},"source":["# **Cyclistic Bike-Share: Case Study**\n","## **Background**:\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of more than 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike.The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclist users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","\n","\n","## **Stakeholders and Team**\n","* Lily Moreno: Director of Marketing\n","* Marketing Analytics Team: Team responsible for collecting, analyzing, and reporting data.\n","* Cyclistic Executive Team: The notoriously detailed-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","## **About the Company:**\n","Cyclistic has 3 different pricing tiers: *single-ride passes, full-day passes and annual memberships.* Customers who purchase **single ride or full day passses are referred to as causal riders.** Customers who purchase **annual memberships are Cyclistic members.**\n","Cyclistic's finance analysts have determined that annual members are much more profitable than casual riders. Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all new customers, Moreno believes there is a very good chance to convert casual riders into members."]},{"cell_type":"markdown","id":"fb14c3d6","metadata":{"papermill":{"duration":0.045737,"end_time":"2022-08-18T11:36:28.595318","exception":false,"start_time":"2022-08-18T11:36:28.549581","status":"completed"},"tags":[]},"source":["## **Cyclistic Trip Data 2021 June to 2022 May**\n","#### **Load libraries and set working directories**"]},{"cell_type":"code","execution_count":1,"id":"7769d68a","metadata":{"execution":{"iopub.execute_input":"2022-08-18T11:36:28.696327Z","iopub.status.busy":"2022-08-18T11:36:28.692505Z","iopub.status.idle":"2022-08-18T11:36:30.187366Z","shell.execute_reply":"2022-08-18T11:36:30.185563Z"},"papermill":{"duration":1.546506,"end_time":"2022-08-18T11:36:30.187588","exception":false,"start_time":"2022-08-18T11:36:28.641082","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.4     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.3     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.1     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats