xecution":{"iopub.execute_input":"2022-08-18T11:39:28.395795Z","iopub.status.busy":"2022-08-18T11:39:28.393824Z","iopub.status.idle":"2022-08-18T11:39:31.9785Z","shell.execute_reply":"2022-08-18T11:39:31.977282Z"},"papermill":{"duration":3.69365,"end_time":"2022-08-18T11:39:31.978663","exception":false,"start_time":"2022-08-18T11:39:28.285013","status":"completed"},"tags":[]},"outputs":[],"source":["counts <- aggregate(all_trips$ride_length ~ all_trips$member_casual + all_trips$day_of_week, FUN = mean)"]},{"cell_type":"markdown","id":"4182d9a8","metadata":{"papermill":{"duration":0.103801,"end_time":"2022-08-18T11:39:32.187339","exception":false,"start_time":"2022-08-18T11:39:32.083538","status":"completed"},"tags":[]},"source":["\n","## **Share:**\n","Based on the analysis, we can infer that\n","\n","**** Total ride shared by each group;****\n","Number of rides taken by members is 56.7%(2,647,937) and Casual riders is 43.3%(2,019,136). However,\n","The Average ride length of Casual riders is 2X more than that of members. This means the company has many Casual riders especially on Weekends.\n","* During the weekend number of Casual rides doubles up compared to weekend, while number of member remains constant throughout the week therefore no significant changes is seen.\n","* It also shows that casuals on weekend and holidays tend to take longer rides than weekdays.\n","* Average ride duration of casual riders increases as from month of June, July and August.\n","* Most prefered type of bike is the classic, followed by electric and finaly docked.\n","It was also noted that non of the members use Docked bikes they Only use Classic or Electric bikes.\n","\n","## ** Recommendations**\n","After Analyzing and finding out how the Casual riders differ from members:\n","\n","1. The company can decide to design or create short-term memberships. This will encourage casual riders to get the memberships for a specific duration they want.\n","2. Increase the renting price of the bikes for the weekend due to high demand, so as to target casual users into having a membership, especially for classic and electric bikes, since they are preferred more by casual users. This will make the casual riders to incline to membership since its cheaper.\n","3. Design a membership Package like merchandise that will be of value to members. Example is points that are redeemable, wrist fitness watch or an App for checking calories burner,diaries or water bottles.\n","4. For Renewing members you can offer them discounts , prizes depending on the years the have been using the service, by doing this more casuals will incline to membership.\n","5. If Casuals are charged based on duration, it tend to be expensive, you can offer discount for regular users. This way users will be encouraged to take membership.\n","6. Running effective and effiecint promotions that will target Casual Users. This will done by putting banners or special discount advertisements at stations,on weekends and months with the most Casual Rides."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":187.481739,"end_time":"2022-08-18T11:39:32.603201","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-18T11:36:25.121462","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}